import React from 'react'
import './App.css'
import data from './list.json'

function List(){
    // console.log(data)
    return(
        // <h1>pawan</h1>
        data.map( movie => <h6> {movie.movie_name} {movie.thumbnail_link}  </h6>)
    )
}

export default List;
